";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"Säkerhetsuppdatering 4.9.5 har släppts – manuell uppdatering kan behövas.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"https://sv.wordpress.org/2018/04/04/sakerhetsuppdatering-4-9-5-har-slappts-manuell-uppdatering-kan-behovas/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:116:\"https://sv.wordpress.org/2018/04/04/sakerhetsuppdatering-4-9-5-har-slappts-manuell-uppdatering-kan-behovas/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 03 Apr 2018 23:01:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"WordPress Sverige\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://sv.wordpress.org/?p=1129\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:411:\"Natten mot 4 april släpptes en säkerhetsuppdatering, WordPress 4.9.5. För de flesta kommer denna version att installeras automatiskt, men om din webbplats fortfarande kör WordPress 4.9.3 behöver du gå till Adminpanelen → Hem → Uppdateringar och klicka på knappen ”Uppdatera nu”. (Eventuellt uppdateras din webbplats på annat sätt. I så fall bör webbplatsens huvudadministratör veta [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Tor-Bjorn Fjellner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:648:\"<p>Natten mot 4 april släpptes en säkerhetsuppdatering, WordPress 4.9.5.</p>\n<p>För de flesta kommer denna version att installeras automatiskt, men om din webbplats fortfarande kör WordPress 4.9.3 behöver du gå till Adminpanelen → Hem → Uppdateringar och klicka på knappen ”Uppdatera nu”.</p>\n<p>(Eventuellt uppdateras din webbplats på annat sätt. I så fall bör webbplatsens huvudadministratör veta hur det görs.)</p>\n<p>Mer information om denna version och vilka problem som åtgärdats finns i nyhetsnotisen <a href=\"https://wordpress.org/news/2018/04/wordpress-4-9-5-security-and-maintenance-release/\">på engelska</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:112:\"https://sv.wordpress.org/2018/04/04/sakerhetsuppdatering-4-9-5-har-slappts-manuell-uppdatering-kan-behovas/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"Om du har WordPress 4.9.3 behöver du uppdatera manuellt till version 4.9.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"https://sv.wordpress.org/2018/02/06/om-du-har-wordpress-4-9-3-behover-du-uppdatera-manuellt-till-version-4-9-4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:119:\"https://sv.wordpress.org/2018/02/06/om-du-har-wordpress-4-9-3-behover-du-uppdatera-manuellt-till-version-4-9-4/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Feb 2018 17:14:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"WordPress Sverige\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://sv.wordpress.org/?p=1053\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:370:\"I går, 5 februari 2018 släpptes WordPress version 4.9.3. Tyvärr fanns det ett fel i den versionen som gör att automatiska uppdateringar inte fungerar som de ska. Därför har idag WordPress 4.9.4 släppts, som rättar till detta problem. Men eftersom den automatiska uppdateringen inte fungerar i version 4.9.3 behöver du gå till sidan för uppdateringar [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Tor-Bjorn Fjellner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:885:\"<p>I går, 5 februari 2018 släpptes WordPress version 4.9.3.<br />\nTyvärr fanns det ett fel i den versionen som gör att automatiska uppdateringar inte fungerar som de ska. Därför har idag WordPress 4.9.4 släppts, som rättar till detta problem.<br />\nMen eftersom den automatiska uppdateringen inte fungerar i version 4.9.3 behöver du gå till sidan för uppdateringar och klicka på ”Uppdatera nu” för att installera den senaste versionen.</p>\n<p>Varken 4.9.3 eller 4.9.4 innehåller några rättningar av säkerhetsproblem. Men du bör ändå se till att installera version 4.9.4 så snart som möjligt för att inte missa säkerhetsuppdateringarna när det blir dags nästa gång. Mer information (på engelska) finns i ett <a href=\"https://make.wordpress.org/core/2018/02/06/wordpress-4-9-4-release-the-technical-details/\">inlägg på WordPress tekniska blogg</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:116:\"https://sv.wordpress.org/2018/02/06/om-du-har-wordpress-4-9-3-behover-du-uppdatera-manuellt-till-version-4-9-4/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"WordPress-träff i Stockholm den 22 februari – Hur väljer man rätt WordPress-tillägg?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:118:\"https://sv.wordpress.org/2018/02/01/wordpress-traff-i-stockholm-den-22-februari-hur-valjer-man-ratt-wordpress-tillagg/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:126:\"https://sv.wordpress.org/2018/02/01/wordpress-traff-i-stockholm-den-22-februari-hur-valjer-man-ratt-wordpress-tillagg/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 01 Feb 2018 14:11:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:7:\"Meetups\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:17:\"WordPress Sverige\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://sv.wordpress.org/?p=1047\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:339:\"Den 22 februari går nästa WordPress-träff (meetup) av stapeln i Stockholm! Klicka här för att anmäla dig. Eventet är gratis. Tillägg är en viktig del av WordPress, men det finns så många att välja mellan! Vad ska man tänka på och hur gör man rätt val? När ska man istället skriva sina egna tillägg? Tillsammans [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Stanislav Khromov\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1679:\"<p><a href=\"https://sv.wordpress.org/files/2018/02/highres_468032078.jpeg\"><img class=\"alignnone size-large wp-image-1048\" src=\"https://sv.wordpress.org/files/2018/02/highres_468032078-1024x683.jpeg\" alt=\"\" width=\"612\" height=\"408\" srcset=\"https://sv.wordpress.org/files/2018/02/highres_468032078-1024x683.jpeg 1024w, https://sv.wordpress.org/files/2018/02/highres_468032078-300x200.jpeg 300w, https://sv.wordpress.org/files/2018/02/highres_468032078-768x512.jpeg 768w\" sizes=\"(max-width: 612px) 100vw, 612px\" /></a></p>\n<p>Den 22 februari går nästa WordPress-träff (meetup) av stapeln i Stockholm!</p>\n<p><a href=\"https://www.meetup.com/WordPress-Stockholm/events/247292938/\"><strong>Klicka här för att anmäla dig.</strong></a> Eventet är gratis.</p>\n<p><em>Tillägg är en viktig del av WordPress, men det finns så många att välja mellan! Vad ska man tänka på och hur gör man rätt val? När ska man istället skriva sina egna tillägg? Tillsammans ska vi analysera och diskutera detta ämne, och förhoppningsvis bli klokare tillsammans!</em></p>\n<p><strong>Schema</strong><br />\n18:00 &#8211; Meet &amp; Greet<br />\n18:15 &#8211; Stanislav Khromov &#8211; Vad ska man tänka på när man väljer tillägg?<br />\n18:45 &#8211; Johan Falk &#8211; Case study<br />\n19:15 &#8211; Paus med något enkelt att äta<br />\n19:45 &#8211; Andreas Ek &#8211; Diskussionsgrupp: Vilka fem tillägg skulle du ta med dig till en öde ö? Vilka egenskaper har ett bra tillägg? Hur väljer man rätt?<br />\n20:45 &#8211; Vi avslutar kvällen</p>\n<p><a href=\"https://www.meetup.com/WordPress-Stockholm/events/247292938/\"><strong>Klicka här för att anmäla dig.</strong></a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:123:\"https://sv.wordpress.org/2018/02/01/wordpress-traff-i-stockholm-den-22-februari-hur-valjer-man-ratt-wordpress-tillagg/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"Säkerhetsuppdatering av WordPress, version 4.9.2, har släppts. Se till att din webbplats är uppdaterad!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:136:\"https://sv.wordpress.org/2018/01/17/sakerhetsuppdatering-av-wordpress-version-4-9-2-har-slappts-se-till-att-din-webbplats-ar-uppdaterad/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:144:\"https://sv.wordpress.org/2018/01/17/sakerhetsuppdatering-av-wordpress-version-4-9-2-har-slappts-se-till-att-din-webbplats-ar-uppdaterad/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 17 Jan 2018 15:37:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"WordPress Sverige\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://sv.wordpress.org/?p=1043\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:478:\"Natten till idag (2018-01-17), svensk tid, släpptes en säkerhetsuppdatering för WordPress. Den senaste versionen är nu 4.9.2. Samtidigt släpptes motsvarande säkerhetsuppdatering för tidigare WordPress-versioner, ända tillbaka till version 3.7. I standardkonfigurationen kommer WordPress att automatiskt uppdateras till den senaste säkerhetsuppdateringen inom samma version. Men om automatiska uppdateringar av någon anledning är blockerade på din webbplats [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Tor-Bjorn Fjellner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:795:\"<p>Natten till idag (2018-01-17), svensk tid, släpptes en säkerhetsuppdatering för WordPress. Den senaste versionen är nu 4.9.2.<br />\nSamtidigt släpptes motsvarande säkerhetsuppdatering för tidigare WordPress-versioner, ända tillbaka till version 3.7.</p>\n<p>I standardkonfigurationen kommer WordPress att automatiskt uppdateras till den senaste säkerhetsuppdateringen inom samma version. Men om automatiska uppdateringar av någon anledning är blockerade på din webbplats bör du så snart som möjligt se till att uppdatera via menyn Panel &#8211; Uppdateringar.</p>\n<p>Mer information om den gångna nattens uppdatering finns att läsa i den <a href=\"https://wordpress.org/news/2018/01/wordpress-4-9-2-security-and-maintenance-release/\">officiella nyheten</a> (på engelska).</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:141:\"https://sv.wordpress.org/2018/01/17/sakerhetsuppdatering-av-wordpress-version-4-9-2-har-slappts-se-till-att-din-webbplats-ar-uppdaterad/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"Dags för utvecklare att bekanta sig med Gutenberg – den kommande redigeringsmiljön för WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:131:\"https://sv.wordpress.org/2018/01/14/dags-for-utvecklare-att-bekanta-sig-med-gutenberg-den-kommande-redigeringsmiljon-for-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:139:\"https://sv.wordpress.org/2018/01/14/dags-for-utvecklare-att-bekanta-sig-med-gutenberg-den-kommande-redigeringsmiljon-for-wordpress/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 14 Jan 2018 19:36:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"WordPress Sverige\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://sv.wordpress.org/?p=1036\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:354:\"Arbetet pågår för fullt med att ta fram en ny miljö för redigering av inlägg och sidor i WordPress. Projektet bär kodnamnet ”Gutenberg”, och för några dagar sedan nådde beta-tillägget version 2.0. I Gutenberg är ”block” ett centralt begrepp. Ett block kan helt enkelt vara en bit text, men också bilder, annan typ av media, [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Tor-Bjorn Fjellner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2301:\"<p>Arbetet pågår för fullt med att ta fram en ny miljö för redigering av inlägg och sidor i WordPress. Projektet bär kodnamnet ”Gutenberg”, och för några dagar sedan nådde beta-tillägget version 2.0.</p>\n<p>I Gutenberg är ”block” ett centralt begrepp. Ett block kan helt enkelt vara en bit text, men också bilder, annan typ av media, eller ett dynamiskt block, vars innehåll kommer att hämtas någon annanstans, ungefär på det sätt vi idag använder kortkoder och widgetar för att placera formulär och annat innehåll.</p>\n<p>Som vanlig användare kan du hjälpa till t.ex. genom att prova Gutenberg och ge återkoppling till utvecklarna om eventuella problem eller oklarheter du stöter på. Gutenberg kan installeras som tillägg och finns på <a href=\"https://translate.wordpress.org/projects/wp-plugins/gutenberg\">https://translate.wordpress.org/projects/wp-plugins/gutenberg</a><br />\nObservera att Gutenberg är ett s.k. <strong>Beta-projekt</strong>. Eftersom olika saker kan komma att ändras innan Gutenberg blir en del av WordPress bör du inte använda på din <em>riktiga</em> webbplats, utan på någon testinstallation.<br />\n<img class=\"alignright size-medium wp-image-1037\" src=\"https://sv.wordpress.org/files/2018/01/gutenberg-banner-1544x500-300x97.jpg\" alt=\"\" width=\"300\" height=\"97\" srcset=\"https://sv.wordpress.org/files/2018/01/gutenberg-banner-1544x500-300x97.jpg 300w, https://sv.wordpress.org/files/2018/01/gutenberg-banner-1544x500-768x249.jpg 768w, https://sv.wordpress.org/files/2018/01/gutenberg-banner-1544x500-1024x332.jpg 1024w, https://sv.wordpress.org/files/2018/01/gutenberg-banner-1544x500.jpg 1544w\" sizes=\"(max-width: 300px) 100vw, 300px\" /><br />\nOm du utvecklar tillägg eller teman finns det all anledning att redan nu bekanta dig med Gutenberg och se till att dina projekt fungerar väl tillsammans med den nya redigeringsmiljön. I synnerhet är detta viktigt om ditt tillägg t.ex. använder kortkoder. Du hittar en kort beskrivning av projektets nuvarande status i ett <a href=\"https://make.wordpress.org/core/2018/01/12/whats-new-in-gutenberg-12th-january/\">inlägg på utvecklingsbloggen för WordPress</a>. Där finns även massor av länkar till djupare information.</p>\n<p>Datum för WordPress 5.0 är inte satt ännu.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:136:\"https://sv.wordpress.org/2018/01/14/dags-for-utvecklare-att-bekanta-sig-med-gutenberg-den-kommande-redigeringsmiljon-for-wordpress/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"WordPress 4.9 ”Tipton” är här!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://sv.wordpress.org/2017/11/16/wordpress-4-9-tipton-ar-har/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://sv.wordpress.org/2017/11/16/wordpress-4-9-tipton-ar-har/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 16 Nov 2017 09:06:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"WordPress Sverige\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://sv.wordpress.org/?p=1023\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:366:\"För några timmar sedan släpptes WordPress version 4.9. Bland de större förbättringarna denna gång hittar vi: Ny widget: Galleri. Och dessutom finns det nu en knapp för att enkelt lägga till media i en textwidget! Förbättringar i ”Anpassaren” Det är lättare än någonsin att byta tema: I högre grad än tidigare följer widgetar och andra [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Tor-Bjorn Fjellner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2513:\"<p>För några timmar sedan släpptes WordPress version 4.9.</p>\n<p>Bland de större förbättringarna denna gång hittar vi:</p>\n<ul>\n<li style=\"list-style-type: none\">\n<ul>\n<li>Ny widget: Galleri. Och dessutom finns det nu en knapp för att enkelt lägga till media i en textwidget!</li>\n<li>Förbättringar i ”Anpassaren”\n<ul>\n<li>Det är lättare än någonsin att byta tema: I högre grad än tidigare följer widgetar och andra inställningar med när du byter tema</li>\n<li>Tidsinställda anpassningspaket: Nu kan du via anpassaren ställa in olika ändringar i utseendet hos din webbplats som automatiskt aktiveras &#8211; t.ex. på lucia eller julafton</li>\n<li>Förhandsvisa ändringar i anpassaren till andra personer: Du kan ta fram en speciell länk för att låta någon annan person se en förhandsvisning av webbplatsens nya design!</li>\n<li>Mindre risk att design-anpassningar går förlorade: WordPress ser till att olika personers designanpassningar inte ”skriver över” varandra. Och du får en påminnelse om att spara ”utkast” till designändringar om du är på väg att missa det</li>\n</ul>\n</li>\n<li>Förbättringar för den som skriver kod direkt i WordPress\n<ul>\n<li>Syntaxmarkering av kod: I t.ex. fältet för ”Extra CSS” och i widgeten för anpassad html kommer du att se mycket bättre vad du verkligen skriver, tack vare syntaxmarkering av koden</li>\n<li>Kontroll av kod innan den läggs in i webbplatsen: När du försöker spara ändrad kod kommer WordPress att automatiskt granska koden först. Detta ger inte på långa vägar något hundrprocentigt skydd, men innebär betydligt mindre risk för att du råkar döda din webbplats t.ex. genom att missa ett semikolon någonstans</li>\n</ul>\n</li>\n<li>För utvecklare: Det finns fler godsaker under huven. Kolla in det <a href=\"https://wordpress.org/news/2017/11/tipton/\">officiella inlägget om lanseringen av version 4.9</a> för ytterligare information.</li>\n</ul>\n</li>\n</ul>\n<p>Det är enkelt att skaffa version 4.9!<br />\nOm du redan har WordPress kan du uppdatera via ”Panel – Uppdateringar”.<br />\nOm du vill nyinstallera WordPress kan du ladda ned <a href=\"https://sv.wordpress.org/txt-download/\">det svenska installationspaketet för WordPress 4.9</a>.</p>\n<p>PS! I version 4.9 har hjälpverktyget ”Blogga det här” tagits bort ur WordPress-kärnan. Men du kan enkelt installera <a href=\"https://sv.wordpress.org/plugins/press-this/\">”Press This/Blogga det här” som ett tillägg</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://sv.wordpress.org/2017/11/16/wordpress-4-9-tipton-ar-har/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Viktigt säkerhetsuppdatering av WordPress släppt (4.8.3)\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://sv.wordpress.org/2017/10/31/viktigt-sakerhetsuppdatering-av-wordpress-slappt-4-8-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"https://sv.wordpress.org/2017/10/31/viktigt-sakerhetsuppdatering-av-wordpress-slappt-4-8-3/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 31 Oct 2017 17:03:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"WordPress Sverige\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://sv.wordpress.org/?p=1018\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:459:\"Idag, 31 oktober 2017, släpptes WordPress 4.8.3, en viktig säkerhetsuppdatering för WordPress. (Motsvarande säkerhetsuppdatering har även släppts för äldre versioner, ända tillbaks till 3.7.) Med standardinställningarna för WordPress kommer denna säkerhetsuppdatering att utföras automatiskt, men om du av någon anledning har blockerat ”mindre uppdateringar” rekommenderar vi att du så snart som möjligt uppdaterar WordPress. Det [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Tor-Bjorn Fjellner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:486:\"<p>Idag, 31 oktober 2017, släpptes WordPress 4.8.3, en viktig säkerhetsuppdatering för WordPress. (Motsvarande säkerhetsuppdatering har även släppts för äldre versioner, ända tillbaks till 3.7.)<br />\nMed standardinställningarna för WordPress kommer denna säkerhetsuppdatering att utföras automatiskt, men om du av någon anledning har blockerat ”mindre uppdateringar” rekommenderar vi att du så snart som möjligt uppdaterar WordPress. Det tar bara någon minut!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"https://sv.wordpress.org/2017/10/31/viktigt-sakerhetsuppdatering-av-wordpress-slappt-4-8-3/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"Tävla om biljetter till WordCamp Stockholm!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://sv.wordpress.org/2017/10/26/tavla-om-biljetter-till-wordcamp-stockholm/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://sv.wordpress.org/2017/10/26/tavla-om-biljetter-till-wordcamp-stockholm/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 26 Oct 2017 06:51:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"WordPress Sverige\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://sv.wordpress.org/?p=1012\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:122:\"Var med och tävla om tre stycken biljetter till WordCamp Stockholm (19-20 november)! Tävlingen öppen t.o.m. 5 november.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Stanislav Khromov\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:709:\"<p>Nu är det mindre än en månad kvar till WordCamp Stockholm den 19-20 november. Det firar vi med att tävla ut tre stycken biljetter! För att vara med i tävlingen: Skriv en kommentar <a href=\"https://wpsv.se/blogg/tavla-om-biljetter-till-wordcamp-stockholm/\">på detta inlägg på vår community-webbplats wpsv.se</a> och berätta kort (1-2 meningar) om hur WordPress har haft en positiv inverkan på ditt jobb, hobby eller fritid, eller varför du gillar att använda just WordPress för dina webbplatser.</p>\n<p>Tävlingen pågår t.o.m. den 5 November. Lycka till!</p>\n<p>Läs mer om WordCamp Stockholm på: <a href=\"https://2017.stockholm.wordcamp.org/\">https://2017.stockholm.wordcamp.org/</a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"https://sv.wordpress.org/2017/10/26/tavla-om-biljetter-till-wordcamp-stockholm/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"Hela programmet för WordCamp Stockholm klart – Sveriges officiella WordPress-konferens 19–20 november.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:136:\"https://sv.wordpress.org/2017/10/19/hela-programmet-for-wordcamp-stockholm-klart-sveriges-officiella-wordpress-konferens-19-20-november/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:144:\"https://sv.wordpress.org/2017/10/19/hela-programmet-for-wordcamp-stockholm-klart-sveriges-officiella-wordpress-konferens-19-20-november/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 19 Oct 2017 14:57:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"WordPress Sverige\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://sv.wordpress.org/?p=1002\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"Nu är hela programmet för WordCamp Stockholm 2017 klart. Läs mer och anmäl dig!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Tor-Bjorn Fjellner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6729:\"<p>WordCamp Stockholm är den officiella WordPress-konferensen i Sverige 2017.</p>\n<h2>”Contributor Day” 19 november</h2>\n<p><figure id=\"attachment_1003\" aria-describedby=\"caption-attachment-1003\" style=\"width: 300px\" class=\"wp-caption alignright\"><img src=\"https://sv.wordpress.org/files/2017/10/Cx9XVvtXUAI3sin.jpg_large-300x225.jpg\" alt=\"\" width=\"300\" height=\"225\" class=\"size-medium wp-image-1003\" srcset=\"https://sv.wordpress.org/files/2017/10/Cx9XVvtXUAI3sin.jpg_large-300x225.jpg 300w, https://sv.wordpress.org/files/2017/10/Cx9XVvtXUAI3sin.jpg_large-768x576.jpg 768w, https://sv.wordpress.org/files/2017/10/Cx9XVvtXUAI3sin.jpg_large-1024x768.jpg 1024w, https://sv.wordpress.org/files/2017/10/Cx9XVvtXUAI3sin.jpg_large-440x330.jpg 440w, https://sv.wordpress.org/files/2017/10/Cx9XVvtXUAI3sin.jpg_large.jpg 1200w\" sizes=\"(max-width: 300px) 100vw, 300px\" /><figcaption id=\"caption-attachment-1003\" class=\"wp-caption-text\">Så här såg det ut på Contributor Day i fjol</figcaption></figure><br />\nProgrammet inleds med en så kallad <em>Contributor Day</em> som äger rum söndagen 19 november 2017 klockan 9:30–17:00 i företaget DIBS lokaler i centrala Stockholm.</p>\n<p>Huvudtanken med en Contributor Day (ung. <em>dag för bidrag från deltagare</em>) är att vi under avslappnade former gör en insats för att utveckla WordPress och den omkringliggande gemenskapen.</p>\n<p>Vi kommer att ha tre specialiserade grupper som alla startar med en inledande presentation/introduktion och sedan går över i praktiskt arbete:</p>\n<ul>\n<li>Översättning av WordPress</li>\n<li>WordPress-utveckling baserat på ”Composer”</li>\n<li>Supportforum – att ge och få hjälp</li>\n</ul>\n<p>Dessutom kommer vi att ha ett något mer konferensliknande spår som framför allt kretsar kring WooCommerce, en populär e-handelslösning som bygger på WordPress:</p>\n<ul>\n<li>Easy-Peasy checkout for WooCommerce</li>\n<li>Making WordPress and WooCommerce Fast and Scalable</li>\n<li>WooCommerce – hands-on workshop</li>\n</ul>\n<p>Men viktigast av allt på Contributor Day är nog ändå det <em>sociala</em>: Helt enkelt att träffa andra människor som liksom du använder WordPress på olika sätt. Du kanske bara vill hänga med andra WordPress-intresserade? Eller snitsa till din egen webbplats? Här kommer du att vara omgiven av människor som gärna hjälper dig om du skulle köra fast. Och någon kanske vill sitta med och kolla hur just du får din webbplats bli som du vill ha den.</p>\n<p>För att få ut mesta möjliga av denna dag bör du ta med dig egen dator.<br />\nOm du ännu inte har ett eget konto på WordPress.org är det god idé att skapa ett konto i förväg på https://login.wordpress.org/</p>\n<p>Observera att antalet platser under söndagen är begränsat. Vi kommer att skicka ut information till alla konferensdeltagare om hur man bokar sitt deltagande.</p>\n<h2>WordPress-konferens 20 november</h2>\n<p><figure id=\"attachment_1004\" aria-describedby=\"caption-attachment-1004\" style=\"width: 300px\" class=\"wp-caption alignright\"><img src=\"https://sv.wordpress.org/files/2017/10/header-alt-300x186.jpg\" alt=\"\" width=\"300\" height=\"186\" class=\"size-medium wp-image-1004\" srcset=\"https://sv.wordpress.org/files/2017/10/header-alt-300x186.jpg 300w, https://sv.wordpress.org/files/2017/10/header-alt-768x477.jpg 768w, https://sv.wordpress.org/files/2017/10/header-alt-1024x637.jpg 1024w, https://sv.wordpress.org/files/2017/10/header-alt.jpg 1406w\" sizes=\"(max-width: 300px) 100vw, 300px\" /><figcaption id=\"caption-attachment-1004\" class=\"wp-caption-text\">Bild från WordCamp Sverige 2016</figcaption></figure><br />\nPå måndagen är det sedan dags för själva konferensen, som i år genomförs i samarbete med Internetdagarna. Vi kommer att hålla till på Stockholm Waterfront Conference, precis intill Stockholms centralstation.</p>\n<p>Vi har två parallella WordPress-spår, med föreläsningar och diskussioner inom en lång rad olika ämnen som alla berör WordPress på olika sätt. Här är några exempel:</p>\n<ul>\n<li>GDPR för WordPress-användare</li>\n<li>Hur man använder man s.k. hooks och filters för att på rätt sätt lägga till nya funktioner i WordPress</li>\n<li>Användning av tillägget WooCommerce för välgörenhetsorganisationer</li>\n<li>WordPress och WooCommerce som ett verktyg för att förverkliga en företagardröm</li>\n<li>WordPress-säkerhet</li>\n<li>… och mycket mer</li>\n</ul>\n<p>Ungefär hälften av presentationerna kommer att vara på engelska, och resten på svenska. Schemat är planerat så att man ska kunna välja att gå på endast svenska eller endast engelska föreläsningar.</p>\n<p>I rasterna mellan föreläsningarna kan du träffa våra fina sponsorer och mingla med de andra konferensdeltagarna. Kom ihåg dina visitkort, du kommer att behöva dem!</p>\n<h2>Efterfest!</h2>\n<p><figure id=\"attachment_1005\" aria-describedby=\"caption-attachment-1005\" style=\"width: 300px\" class=\"wp-caption alignright\"><img src=\"https://sv.wordpress.org/files/2017/10/window_view_1280x960-300x225.jpg\" alt=\"\" width=\"300\" height=\"225\" class=\"size-medium wp-image-1005\" srcset=\"https://sv.wordpress.org/files/2017/10/window_view_1280x960-300x225.jpg 300w, https://sv.wordpress.org/files/2017/10/window_view_1280x960-768x576.jpg 768w, https://sv.wordpress.org/files/2017/10/window_view_1280x960-1024x768.jpg 1024w, https://sv.wordpress.org/files/2017/10/window_view_1280x960-440x330.jpg 440w, https://sv.wordpress.org/files/2017/10/window_view_1280x960.jpg 1280w\" sizes=\"(max-width: 300px) 100vw, 300px\" /><figcaption id=\"caption-attachment-1005\" class=\"wp-caption-text\">Efterfest på Sky Bar, längst upp i Royal Viking Hotel</figcaption></figure><br />\nPå kvällen måndagen 20 november är du sedan inbjuden av Oderland till efterfest ett par minuters promenad från konferensanläggningen, på <a href=\"https://www.skybarstockholm.se/hem\">Radisson Blu Royal Vikings Sky bar</a>.</p>\n<h2>Vill du bli ”Mikrosponsor”?</h2>\n<p>I samband med biljettköpet kan du välja att låta ditt företag ställa upp som mikrosponsor. Ju fler mikrosponsorer vi får, desto fler subventionerade biljetter kan vi sälja (och desto roligare kommer vi att ha det!)</p>\n<p>För mikrosponsorer publicerar vi deras logga och länk på evenemangets officiella webbplats. Dessutom kommer vi på själva konferensdagen att tacka varje sponsor från podiet för deras bidrag.</p>\n<h2>Pris</h2>\n<p>Tack vare bidragen från våra generösa sponsorer kan vi erbjuda biljetten till WordCamp Stockholm 2017 för endast 600 kronor plus moms (750 kr inkl. moms).</p>\n<h2>Mer information och anmälan</h2>\n<p><a href=\"https://2017.stockholm.wordcamp.org/\">https://2017.stockholm.wordcamp.org/</a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:141:\"https://sv.wordpress.org/2017/10/19/hela-programmet-for-wordcamp-stockholm-klart-sveriges-officiella-wordpress-konferens-19-20-november/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"Delta i beta-testningen av WordPress 4.9\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://sv.wordpress.org/2017/10/12/delta-i-beta-testningen-av-wordpress-4-9/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"https://sv.wordpress.org/2017/10/12/delta-i-beta-testningen-av-wordpress-4-9/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 Oct 2017 11:02:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"WordPress Sverige\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://sv.wordpress.org/?p=999\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:406:\"WordPress 4.9 är på väg att ta form och den andra beta-versionen har just gjorts tillgänglig på svenska. Många av nyheterna i WordPress 4.9 kretsar kring anpassaren, men det finns också en lång rad små förbättringar. Hela listan med nyheter finns i inlägget om beta-1 på den centrala bloggen för WordPress: https://wordpress.org/news/2017/10/wordpress-4-9-beta-1/ Prova gärna denna [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Tor-Bjorn Fjellner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1236:\"<p>WordPress 4.9 är på väg att ta form och den andra beta-versionen har just gjorts tillgänglig <a href=\"https://sv.wordpress.org/builds/sv_SE/tags/4.9.1-beta2/wordpress-4.9.1-beta2-sv_SE.zip\">på svenska</a>.</p>\n<p>Många av nyheterna i WordPress 4.9 kretsar kring anpassaren, men det finns också en lång rad små förbättringar.</p>\n<p>Hela listan med nyheter finns i inlägget om beta-1 på den centrala bloggen för WordPress: <a href=\"https://wordpress.org/news/2017/10/wordpress-4-9-beta-1/\">https://wordpress.org/news/2017/10/wordpress-4-9-beta-1/</a></p>\n<p>Prova gärna denna beta-utgåva, i synnerhet om du har utvecklat något eget tema eller tillägg kan det vara bra att kolla att allting fungerar som det ska. Om du ser något som behöver rättas till, finns det anvisningar för vart du vänder dig i <a href=\"https://wordpress.org/news/2017/10/wordpress-4-9-beta-2/\">inlägget om beta-2 på den centrala bloggen</a>.</p>\n<p>Kom ihåg, dock: Beta-paket är till sin natur mindre stabila än en slutlig release, och om ett problem skulle inträffa finns det risk att enda sättet att lösa problemet är att ”rulla tillbaka” till en tidigare reservkopia. Använd dem därför inte på skarpa webbplatser.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"https://sv.wordpress.org/2017/10/12/delta-i-beta-testningen-av-wordpress-4-9/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:35:\"https://sv.wordpress.org/news/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"\n	hourly	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"\n	1	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:8:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Sat, 14 Apr 2018 14:05:56 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; charset=UTF-8\";s:6:\"x-olaf\";s:3:\"⛄\";s:13:\"last-modified\";s:29:\"Wed, 04 Apr 2018 11:00:23 GMT\";s:4:\"link\";s:61:\"<https://sv.wordpress.org/wp-json/>; rel=\"https://api.w.org/\"\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:9:\"HIT ord 2\";}}s:5:\"build\";s:14:\"20130911040210\";}','no');
